e delicate matters between the different races. Some believe that Onyxia has even assumed an alias once used by her father - the title of the royal House Prestor. When not meddling in mortal concerns, Onyxia resides in a fiery cave below the Dragonmurk, a dismal swamp located within Dustwallow Marsh. There she is guarded by her kin, the remaining members of the insidious black dragonflight.",lvl=60,mapID=248,savedInstanceID=249,sourceQuests={6502,6602},u=1608,["zone-text-areaID"]=2159,g={n(-1000031,{q(7635,{awp=10001,c={3},coords={{47,24.48,1448}},cost={{"i",18705,1}},qgs={14525},rwp=40003,sourceQuests={7633},g={i(18724,{b=1,c={3},rwp=40003})}}),q(7634,{awp=10001,c={3},coords={{47,24.48,1448}},cost={{"i",18704,1}},maps={1452},qgs={14526},rwp=40003,sourceQuests={7633},g={i(18714,{b=1,c={3},f=113,rwp=40003})}}),q(7496,{awp=10001,coords={{67.2,85.1,1453}},qgs={1748},r=2,rwp=100000,sourceQuests={7495},g={i(18403,{b=1,f=52,rwp=100000}),i(18406,{b=1,f=53,rwp=100000}),i(18404,{b=1,f=51,rwp=100000})}}),q(7491,{awp=10001,coords={{32,37.8,1454}},qgs={4949},r=1,rwp=100000,sourceQuests={7490},g={i(18403,{b=1,f=52,rwp=100000}),i(18404,{b=1,f=51,rwp=100000}),i(18406,{b=1,f=53,rwp=100000})}}),q(7507,{c={1,2},description="You get this quest by looting Nostro's Compendium from bosses in Dire Maul.\n\nYou can also buy it on the Auction House for a hefty price!",maps={234},providers={{"i",18401}},rwp=30300,g={i(18513,{b=1,rwp=30300})}}),q(7636,{awp=10001,c={3},coords={{47,24.48,1448}},description="You must defeat the 4 demons listed below by yourself with no pet in order to complete this quest.",maps={1428,1449,1451,1452},providers={{"i",18708}},qgs={14524},rwp=40003,sourceQuests={7633},g={qo(1,{coords={{34.5,41.1,1449}},crs={14527,14533},description="There are two things that can make this fight difficult: her pet, a felhound named Precious and low nature resistance. Most hunters tend to CC Precious by freeze trapping it. Using ranged attacks is useless because she casts a debuff that substantially lowers ranged attack power. Your best bet is to use aspect of the wild + a greater nature protection potion (to dull and absorb her lightning bolts) and melee her until she falls.\n\nLocated in Ungoro Crater.",providers={{"i",18952}},rwp=40003}),qo(2,{coords={{25.3,65.9,1428}},crs={14529,14534},description="Use Concussive Shot/Serpent Sting to kite him down the road. You should know how long serpent sting lasts, use only one per trip down the road, more if you think you can risk it. As soon as it's worn off, drop an ice trap, let him stand in it, go to the other side, max range, and start again. If for whatever reason he breaks trap, you can use scatter shot, or use concussive shot to just keep kiting him in a circle until the cooldown finishes.\n\nDo not worry about his enrage, because he won't be touching you at all if you play right.\n\nLocated in the Burning Steppes.",providers={{"i",18953}},rwp=40003}),qo(3,{coords={{24.7,76,1451}},crs={14530,14536},description="This is the hardest demon:\n\nStrengths:\n* He does NOT predictably chase you. He frequently stops to fear (disorienting you and causing around 800 damage also) or will stop to shoot homing beetles at you.\n* The homing beetles basically prevent you from bandaging. They move extremely slow but hit extremely hard\n* If you leave melee range (further than 2-3 range or so), he uses an instant cast fear spell that also does 700-800 damage instantly, and he can cast these quickly, almost seemingly chain casting. Shadow protection potions do absorb this damage, however, even with greater potions, he tears through them very fast. It's also likely that the fear will send you into the homing beetles\n* Seemingly unlimited mana bar, so Viper Sting is useless\n* Scorpid sting has very little/no effect on him\n* Melees extremely hard and fast (200+) when in normal form\n\nWeaknesses:\n* If you use Rank 3 Wing Clip on him, it immobilizes him completely with \"Crippling Clip\" for 30 seconds.\n* The homing missiles (creepings) are not fired when you remain in melee range\n* He does NOT cast his fear when you remain in melee range\n* Must be 'chilled' via Frost Trap prior to fully engaging\n\nLocated in Silithus.",providers={{"i",18954}},rwp=40003}),qo(4,{coords={{60.3,13.2,1452}},crs={14531,14535},description="Kite him using Aspect of the Cheetah. Keep Serpent Sting on at all times and use Concussive Shot whenever he gets close. It is important to remain beyond 30 yards of the Demonic Doom, yet within range to use Arcane Shot so that he continues chasing you. If you rely completely on Serpent Sting for damage, he will break aggro and return to where he started. Once you apply Serpent Sting, count to 4, and apply it again before it wears off (the damage does stack). You will be able to see this by a 2nd damage listing \"Stinging Trauma\", which will continue to increase each time the sting is applied.\n\nBe sure to clear the area you plan on fighting so as to not get dazed by another NPC wandering by.\n\nLocated in Winterspring.",providers={{"i",18955}},rwp=40003}),i(18707,{b=1,cost={{"i",18724,1}},rwp=40003,g={s(129617,18713,{b=1,c={3},f=32,rwp=40003})}}),s(129619,18715,{b=1,c={3},description="Go back to Felwood after having completed all the quests and a chat icon will become available, allowing you to interact with one of the ancients. Speak to him and he will give you the staff.",f=28,rwp=40003,sourceQuests={7634,7635,7636}})}}),q(7508,{c={1,2},maps={234},providers={{"i",18513}},qgs={14368},rwp=30300,sourceQuests={7507}}),q(7509,{c={1,2},maps={234},qgs={14368},rwp=30300,sourceQuests={7508},g={qo(1,{cost={{"i",18488,1}},crs={10184},description="Drops from Onyxia when you use the Heated Ancient Blade on her corpse.",providers={{"i",18492}},rwp=30300}),i(18488,{cost={{"i",18489,1}},description="Once the boss uses her Breath attack on your Unfired Ancient Blade, loot this item from the ground and then impale the corpse of Onyxia once you defeat her.",providers={{"o",179562}},rwp=30300}),i(18489,{b=1,description="Place this in front of Onyxia's Breath attack during The Forging of Quel'Serrar quest.\n\nYou may want to delay placing this item on the ground until the breath goes on cooldown during Phase 3.\n\nAs a note you can heat the blade in Phase 1 or 3. The Heated Ancient Blade has a deteriation time of 20 minutes. This is NOT a cooldown. Once the time runs out it will not change back into the Unfired Ancient Blade. It will instead disappear from your inventory and you will have to get a replacement for it by returning to DM, abandoning the quest, and reaccepting.",rwp=30300}),s(201131,18348,{b=1,c={1,2},f=25,rwp=30300})}}),q(7497,{coords={{67,85,1453}},learnedAt=300,qgs={14394},r=2,requireSkill=165,sourceQuests={7496},g={r(19093,{awp=10001,itemID=15769,learnedAt=300,requireSkill=165,rwp=100000})}}),q(7493,{coords={{52.2,75.8,1454}},learnedAt=300,qgs={14392},r=1,requireSkill=165,sourceQuests={7491},g={r(19093,{awp=10001,itemID=15769,learnedAt=300,requireSkill=165,rwp=100000})}}),q(7495,{awp=10001,maps={1453},providers={{"i",18423}},r=2,rwp=100000}),q(7490,{awp=10001,maps={1454},providers={{"i",18422}},r=1,rwp=100000})}),prof(393,{i(15410)}),n(10184,{ach(684,{awp=10001,OnUpdate=handlers.ANY_SOURCE_QUEST,rwp=100000,sourceQuests={7490,7495,7509,7635,8620}}),i(18423,{awp=10001,b=1,r=2,rwp=100000}),i(18422,{awp=10001,b=1,r=1,rwp=100000}),i(18705,{b=1,c={3},rwp=40003}),i(17966,{awp=10001,b=1,f=113,rwp=100000}),s(128742,17068,{awp=10001,b=1,f=21,rwp=100000}),s(128749,17075,{awp=10001,b=1,f=25,rwp=100000}),s(128741,17067,{awp=10001,b=1,f=1,rwp=100000}),s(128583,16908,{b=1,c={4},f=5}),s(128614,16939,{b=1,c={3},f=6}),s(128596,16921,{b=1,c={5},f=4}),s(128638,16963,{b=1,c={1},f=7}),s(128622,16947,{b=1,c={7},f=6}),s(128630,16955,{b=1,c={2},f=7}),s(128604,16929,{b=1,c={9},f=4}),s(128589,16914,{b=1,c={8},f=4}),s(128575,16900,{b=1,c={11},f=5}),i(18205,{awp=10001,b=1,f=51,rwp=100000}),s(128752,17078,{awp=10001,b=1,f=3,rwp=100000}),i(18813,