},u=1605}),i(211450,{b=1,f=53,rwp=20001,sourceQuests={78916,78917},u=1605})}}),q(78925,{awp=11500,coords={{38.3,43,1457}},qgs={4784},r=2,rwp=20001,u=1605,g={qo(1,{crs={4809,4810,4811,4812,4813,4814},providers={{"i",5879}},rwp=20001,u=1605}),i(211466,{b=1,f=5,rwp=20001,u=1605}),i(211465,{b=1,f=4,rwp=20001,u=1605})}})}}),n(-1000030,{rwp=20001,u=1605,g={n(212159,{OnUpdate=_.OnUpdateForCrafter,rwp=20001,sourceQuests={78907},u=1605,g={i(211419,{b=1,rwp=20001,u=1605})}}),o(411358,{OnUpdate=_.OnUpdateForCrafter,providers={{"i",211420}},rwp=20001,sourceQuests={78909},u=1605,g={i(211421,{awp=11500,b=1,rwp=20001,u=1605})}})}}),n(-1000038,{description="After dealing with Aku'mai, you can head back to Lady Sarevess' cave and delve deeper, now that the waterfall is gone. At the very end of the cave, you will be able to loot the recipes from a table.",rwp=20001,u=1605,g={r(430409,{b=1,itemID=211849,learnedAt=100,providers={{"o",415614}},requireSkill=333,rwp=20001,u=1605}),r(430397,{b=1,itemID=211846,learnedAt=100,providers={{"o",415614}},requireSkill=164,rwp=20001,u=1605})}}),n(-1000010,{crs={204921,207356,209678,213334},description="The Twilight armor sets can drop from any of the last 4 bosses.",rwp=20001,u=1605,g={i(211505,{b=1,f=6,rwp=20001,u=1605}),i(211504,{b=1,f=6,rwp=20001,u=1605}),i(211506,{b=1,f=6,rwp=20001,u=1605}),i(211507,{b=1,f=5,rwp=20001,u=1605}),i(211509,{b=1,f=5,rwp=20001,u=1605}),i(211508,{b=1,f=5,rwp=20001,u=1605}),i(209683,{b=1,f=4,rwp=20001,u=1605}),i(209671,{b=1,f=4,rwp=20001,u=1605}),i(209669,{b=1,f=4,rwp=20001,u=1605}),i(211510,{b=1,f=5,rwp=20001,u=1605}),i(211512,{b=1,f=5,rwp=20001,u=1605}),i(211511,{b=1,f=5,rwp=20001,u=1605})}}),n(202699,{description="Baron Aquanis sits stationary atop three broken platforms, and raid members must dodge his mechanics to avoid being thrown into the water and possibly aggroing extra enemies - Bubble Beam knocks enemies in front of him, and Depth Charge knocks back anyone close to the target! In addition to this, players must jump through platforms to avoid Torrential Downpour damage.",rwp=20001,u=1605,g={i(211454,{b=1,r=1,rwp=20001,u=1605}),i(204807,{b=1,f=26,rwp=20001,u=1605}),i(209590,{b=1,f=1,rwp=20001,u=1605}),i(209825,{b=1,f=51,rwp=20001,u=1605}),i(209422,{b=1,f=51,rwp=20001,u=1605}),i(209423,{b=1,f=3,rwp=20001,u=1605}),i(209676,{b=1,f=6,rwp=20001,u=1605}),i(209828,{b=1,f=4,rwp=20001,u=1605}),i(204804,{b=1,f=6,rwp=20001,u=1605}),i(211852,{b=1,f=4,rwp=20001,u=1605}),i(209421,{b=1,f=5,rwp=20001,u=1605}),i(209677,{b=1,f=52,rwp=20001,u=1605})}}),n(201722,{description="Ghamoo-ra patrols around an island and requires clearing around the area before being engageed. In the fight itself, tanks must taunt swap to avoid massive stacks of Crunch Armor, while other members of the raid must deal with Ghamoo-ra's shield, Aqua Shell - Deal damage to break it. Once Aqua Shell is broken, DPS the turtle down while dealing with massive raid-wide damage!",rwp=20001,u=1605,g={i(209436,{b=1,f=20,rwp=20001,u=1605}),i(209830,{b=1,f=33,rwp=20001,u=1605}),i(209424,{b=1,f=8,rwp=20001,u=1605}),i(209523,{b=1,f=3,rwp=20001,u=1605}),i(209678,{b=1,f=5,rwp=20001,u=1605}),i(209824,{b=1,f=6,rwp=20001,u=1605}),i(209418,{b=1,f=6,rwp=20001,u=1605}),i(209675,{b=1,f=4,rwp=20001,u=1605}),i(209524,{b=1,f=5,rwp=20001,u=1605}),i(209432,{b=1,f=4,rwp=20001,u=1605})}}),n(204068,{description="Lady Sarevess is accompanied by a tanky Blackfathom Elite that needs to be off-tanked. The main mechanic players must deal with is Freezing Arrow, in which a player is randomly targetted by an arrow that leaves a frost patch that the off-tank can move the Blackfathom Elite to stun it for a short duration. In addition to this, spread out to not chain Forked Lightning damage!",rwp=20001,u=1605,g={i(209564,{b=1,f=29,rwp=20001,u=1605}),i(209525,{b=1,f=25,rwp=20001,u=1605}),i(209563,{b=1,f=32,rwp=20001,u=1605}),i(209822,{b=1,f=23,rwp=20001,u=1605}),i(211789,{b=1,f=5,rwp=20001,u=1605}),i(211843,{b=1,f=6,rwp=20001,u=1605}),i(211842,{b=1,f=4,rwp=20001,u=1605}),i(209680,{b=1,f=3,rwp=20001,u=1605}),i(209679,{b=1,f=4,rwp=20001,u=1605}),i(209527,{b=1,f=5,rwp=20001,u=1605}),i(209566,{b=1,f=6,rwp=20001,u=1605}),i(209565,{b=1,f=52,rwp=20001,u=1605}),i(209823,{b=1,c={3},f=52,rwp=20001,u=1605})}}),n(204921,{description="Gelihast has a quite dangerous curse with Curse of Blackfathom, so you must have ways to decurse it off. The raid must avoid getting hit by Shadow Crash while the tanks taunt swap to prevent reaching high stacks of Shadow Strike. Healers can also dispel the random Fear he throws at people.\n\nThe big mechanic happens once the boss reaches 10% - March of the Murlocs will begin, spawning dozens of murlocs that players must dodge while the boss heals himself and throws more Shadow Crashes. Once fully healed, the fight starts again, with Gelihast summoning low-health Blackfathom Tendril that must be killed. Gelihast will heal himself to full twice with March of the Murlocs before finally dying.",rwp=20001,u=1605,g={i(209567,{b=1,f=22,rwp=20001,u=1605}),i(209571,{b=1,f=27,rwp=20001,u=1605}),i(209559,{b=1,f=28,rwp=20001,u=1605}),i(209573,{b=1,f=28,rwp=20001,u=1605}),i(209570,{b=1,f=1,rwp=20001,u=1605}),i(209820,{b=1,f=51,rwp=20001,u=1605}),i(209568,{b=1,f=6,rwp=20001,u=1605}),i(209572,{b=1,f=5,rwp=20001,u=1605}),i(209569,{b=1,f=5,rwp=20001,u=1605}),i(209670,{b=1,f=4,rwp=20001,u=1605}),i(209821,{b=1,f=52,rwp=20001,u=1605}),i(209681,{b=1,f=53,rwp=20001,u=1605}),i(211491,{b=1,f=113,rwp=20001,u=1605})}}),n(207356,{description="Lorgus Jett can be found behind a gauntlet of Naga and Murlocs that must be dealt with before engaging the boss itself. Lorgus Jett himself has 3 totems he will use - One totem is spawned every 10 seconds in a set order. You can simply ignore two out of the three totems and DPS Lorgus Jett:\n\n    Corrupted Windfury Totem - Ignore and tank through his enhanced attacks;\n    Corrupted Lightning Shield Totem - Kill this totem immediately once it spawns;\n    Corrupted Molten Fury Totem - Ignore this totem and dodge the molten boulders it spawns.",rwp=20001,u=1605,g={i(209579,{b=1,f=34,rwp=20001,u=1605}),i(209577,{b=1,f=24,rwp=20001,u=1605}),i(209560,{b=1,f=23,rwp=20001,u=1605}),i(209818,{b=1,f=20,rwp=20001,u=1605}),i(209682,{b=1,f=5,rwp=20001,u=1605}),i(209578,{b=1,f=5,rwp=20001,u=1605}),i(209581,{b=1,f=6,rwp=20001,u=1605}),i(209575,{b=1,rwp=20001,u=1605}),i(209574,{b=1,rwp=20001,u=1605}),i(209576,{b=1,rwp=20001,u=1605})}}),n(209678,{description="Kelris is a two-phase fight with Phase 1 starting on pull and Phase 2 starting at 35%, so DPS must hold their big cooldowns until Kelris enters Phase 2. Through the fight, players must dodge Shadow Crashes and interrupt Shadowy Chains (priority) and Mind Blast.\n\nThe main difficult in the fight is the Dream Realm mechanic - Every so often, the two closest players to Kelris will be put to Sleep, being sent to a Dream Realm in which they need to kill neutral Phantasmal Priestesses for a chance to spawn a portal to be sent back to reality. After 30 seconds in the Dream Phase, the Priestesses will become aggressive and attack the two players on the Dream Realm. If possible, avoid using casters to go to the Dream Realm, as the Priestesses have high magical resistance.\n\nOnce Kelris reaches 35%, Phase 2 will start - Kelris will no longer send players to the Dream Realm, but will deal increased damage, in addition to his previous interruptible spells now being immune to interrupts. Save your resources and spread around the room to burn the boss down!",rwp=20001,u=1605,g={i(209561,{b=1,f=28,rwp=20001,u=1605}),i(209694,{b=1,f=20,rwp=20001,u=1605}),i(209674,{b=1,f=27,rwp=20001,u=1605}),i(211458,{b=1,f=1,rwp=20001,u=1605}),i(209673,{b=1,f=51,rwp=20001,u=1605}),i(209686,{b=1,f=51,rwp=20001,u=1605}),i(209817,{b=1,f=51,rwp=20001,u=1605}),i(209672,{b=1,f=4,rwp=20001,u=1605}),i(211455,{b=1,f=5,rwp=20001,u=1605}),i(211457,{b=1,f=6,rwp=20001,u=1605}),i(209667,{b=1,f=4,rwp=20001,u=1605}),i(209668,{b=1,f=52,rwp=20001,u=1605}),i(209816,{b=1,c={9},f=53,rwp=20001,u=1605}),i(211492,{b=1,c={9},f=113,rwp=20001,u=1605})}}),n(213334,{description="Once engaged, all raid members should stay close to Aku'mai at all times, to easily dodge the Corrosive Blast cones. Getting hit by this gives a stack of Corrosion. Tanks will naturally be affected with Corrosion over time, and once they reach 3-4 stacks of Corrosion, they must drag themselves and the boss to one of the four Cleansing Pool scattered across the room - Cleansing themselves and generating adds that must be killed.\n\nOnce Aku'mai hits 50%, he will enter Phase 2 by casting Dark Protection becoming big and voidlike. His abilities remain mostly the same, but now deal Shadow damage instead of Nature. The main difference is that Corrosion becomes Shadow Seep, and tanks must taunt swap to avoid getting high stacks of the debuff. It is possible to cleanse these the same way as you did Corrosion in Phase 1, but it is largely unnecessary if your DPS is good.",rwp=20001,u=1605,g={i(209693,{b=1,rwp=20001,u=1605}),i(211452,{b=1,rwp=20001,u=1605}),i(211456,{b=1,f=20,rwp=20001,u=1605}),i(209562,{b=1,f=26,rwp=20001,u=1605}),i(209691,{b=1,f=1,rwp=20001,u=1605}),i(209534,{b=1,f=33,rwp=20001,u=1605}),i(209688,{b=1,f=31,rwp=20001,u=1605}),i(209580,{b=1,f=1,rwp=20001,u=1605}),i(209690,{b=1,f=6,rwp=20001,u=1605}),i(209692,{b=1,f=5,rwp=20001,u=1605}),i(209687,{b=1,f=5,rwp=20001,u=1605}),i(209685,{b=1,f=5,rwp=20001,u=1605}),i(209684,{b=1,f=4,rwp=20001,u=1605}),i(209689,{b=1,f=6,rwp=20001,u=1605})}})}})}}),inst(228,{coords={{39.06,18.12,35}},lore="Once the capital city of the Dark Iron dwarves, this volcanic labyrinth now serves as the seat of power for Ragnaros the Firelord. Ragnaros has uncovered the secret to creating life from stone and plans to build an army of unstoppable golems to aid him in conquering the whole of Blackrock Mountain. Obsessed with defeating Nefarian and his draconic minions, Ragnaros will go to any extreme to achieve final victory.",lvl=42,mapID=242,maps={243},savedInstanceID=230,u=1607,["zone-text-areaID"]=1584,g={n(-1000020,{faction(59,{maps={1427},OnTooltip=function(t, tooltipInfo)	local reputation = t.reputation;	if reputation < 42000 then	local addRepInfo = _.Modules.FactionData.AddReputationTooltipInfo;	addRepInfo(tooltipInfo, reputation, "Turn In Blood & Cores (1x each)",	200,	42000);	addRepInfo(tooltipInfo, reputation, "Turn In Core Leather (2x each)",	150,	42000);	addRepInfo(tooltipInfo, reputation, "Turn In Dark Iron Ore (10x each)",	50,	42000);	end	end})}),n(-1000031,{q(7604,{cost={{"i",17203,1}},description="With a Sulfuron Ingot in your bags, speak with Lokhtos and click on the new chat option to obtain a Thorium Brotherhood Contract.",lvl=60,providers={{"i",18628}},qgs={12944},requireSkill=164,g={r(21161,{itemID=18592,learnedAt=300,requireSkill=164})}}),q(4264,{description="After completing the Abandoned Hope quest, kill trash until this item drops for you. If your group has not yet killed the Dark Keeper, they have a fairly high chance to drop this item as well.",lvl=50,providers={{"i",11446}},r=2,rwp=30002,sourceQuests={4242}}),q(4282,{lvl=50,qgs={9023},r=2,rwp=30002,sourceQuests={4264},g={qo(1,{providers={{"i",11464}}}),qo(2,{providers={{"i",11465}}})}}),q(4022,{altQuests={4023},coords={{95.09,31.56,1428}},cost={{"i",10575,1}},description="If you completed the quest 'Trinkets...' in Searing Gorge, you can complete this quest immediately without having to fight the elite dragon by bringing the Black Dragonflight Molt with you.",lvl=52,qgs={9459},rwp=40003,sourceQuests={3481}}),q(4023,{altQuests={4022},coords={{95.09,31.56,1428}},lvl=52,qgs={9459},rwp=40003,g={qo(1,{coords={{93.2,32.6,1428}},crs={9461},providers={{"i",10575}}})}}),q(4024,{coords={{95.09,31.56,1428}},qgs={9459},rwp=40003,sourceQuests={4022,4023},g={qo(1,{cost={{"i",11231,1}},crs={9016},providers={{"i",11230}}}),s(124689,12066,{b=1,f=3,rwp=40003}),s(124690,12082,{b=1,f=5,rwp=40003}),s(124691,12083,{b=1,f=4,rwp=40003})