 in the nearby dwarven city of Ironforge. There, High Tinker Mekkatorque set out to enlist brave souls to help his people reclaim their beloved city.\n\nIt is rumored that Mekkatorque's once-trusted advisor, Mekgineer Thermaplug, betrayed his people by allowing the invasion to happen. Now, his sanity shattered, Thermaplug remains in Gnomeregan - furthering his dark schemes and acting as the city's new techno-overlord.",lvl=19,mapID=226,maps={227,228,229},savedInstanceID=90,["zone-text-areaID"]=133,g={n(-1000033,{i(9363,{b=1,description="Kill mobs for [Grime-Encrusted Object], clean them at the Sparklematic 5200 to receive this box.",g={i(9280),i(10299,{b=1,f=51,lvl=26}),i(10298,{b=1,f=52,lvl=25})}})}),n(-1000044,{s(122938,9510,{crs={6228,6235,7079,7800},f=6,lvl=27}),s(193798,5108,{crs={6212},f=5,lvl=27}),i(216634,{awp=11501,rwp=20001,u=1606}),s(122932,9490,{crs={6206,6207,6212,6220,6222,6223,6225,6226,6227,6230,6232,6233,6234,6329,7603},f=26,lvl=24}),i(9308),i(9326,{b=1,crs={6212},lvl=28,u=2}),i(216661,{awp=11501,b=1,crs={6212,6228},lvl=40,rwp=20001,u=1606}),i(215430,{awp=11501,rwp=20001,u=1606}),s(122931,9489,{b=1,crs={6212,6220,6227,6230,6232,6233,6234,7603},f=27,lvl=26}),s(122929,9487,{crs={6206,6207,6211,6212,6220,6223,6230,6232,6233,6234,6329,6391,7603},f=31,lvl=24}),s(122933,9491,{f=4,lvl=27}),s(122936,9508,{crs={6212,6223,6230,6232,6233,6234},f=4,lvl=26,requireSkill=202}),s(122930,9488,{crs={6206,6207,6211,6212,6223,6225,6226,6227,6230,6232,6233,6234,6329,7603},f=23,lvl=23}),s(122937,9509,{crs={6206,6207,6212,6218,6220,6223,6227,6230,6232,6233,6234,6329,6391,7603},f=5,lvl=25}),i(9309,{description="These can drop from any mechanical unit in Gnomeregan.",r=2}),s(122928,9486,{crs={6206,6207,6211,6212,6220,6223,6224,6225,6227,6230,6232,6233,6234,6329,6392},f=22,lvl=23}),s(122927,9485,{crs={6206,6207,6212,6220,6223,6226,6227,6230,6232,6233,6234,6329,7603},f=21,lvl=25}),i(9279,{b=1,description="This can be looted from mobs outside of the instance."})}),o(142345,{co