1,cost={{"i",217008,1}},f=4,rwp=20001,u=1606}),i(213328,{b=1,cost={{"i",217009,1}},f=4,rwp=20001,u=1606}),i(213337,{b=1,cost={{"i",217007,1}},f=4,rwp=20001,u=1606}),i(213310,{b=1,cost={{"i",217008,1}},f=4,rwp=20001,u=1606}),i(213329,{b=1,cost={{"i",217009,1}},f=4,rwp=20001,u=1606}),i(213336,{b=1,cost={{"i",217007,1}},f=4,rwp=20001,u=1606}),i(216646,{b=1,cost={{"i",216637,3}},description="Contains random reagents and world drops within. Can also contain epics!",rwp=20001,u=1606})}})}}),n(-1000010,{crs={218242,218537,220072},description="The following can drop from three of the bosses.",rwp=20001,u=1606,g={i(217008,{b=1,rwp=20001,u=1606}),i(217009,{b=1,rwp=20001,u=1606}),i(217007,{b=1,rwp=20001,u=1606}),i(215377,{b=1,f=4,rwp=20001,u=1606}),i(215379,{b=1,f=4,rwp=20001,u=1606}),i(215378,{b=1,f=4,rwp=20001,u=1606})}}),n(216666,{description="Located outside the instance near the teleporter.",rwp=20001,u=1606,g={i(213736,{b=1,rwp=20001,u=1606}),i(9277,{rwp=20001,u=1606}),s(122887,9444,{f=8,rwp=40003,u=1606})}}),n(217280,{description="The Grubbis fight starts with a short gauntlet style fight, a mix of Troggs will spawn in small waves followed by Poison Clouds, you should kite the the Troggs into the Poison Clouds. This causes the Poison Clouds to explode and kill the Troggs and then despawn.\n\nAfter a few waves, Grubbis spawns alongside his basilisk pet - Chomper, because of his pet this fight easier to manage with two tanks, but not required with disciplined damage dealers who focus Grubbis himself - this makes threat more manageable. Additionally, everyone with an interrupt must be paying close attention to Chomper's casts, to kick the Petrify cast - otherwise the only tank will lose threat of both bosses.\n\nOnce he spawns, the waves of Troggs and Poison Clouds continue to spawn, these can be managed through the same means as during the gauntlet by kiting the mobs into the clouds. It is possible to ignore the clouds for uptime and cleave or ignore the adds while focusing the boss but it is not recommended for the average raid.",rwp=20001,u=1606,g={i(213542,{b=1,f=1,rwp=20001,u=1606}),i(213351,{b=1,f=8,rwp=20001,u=1606}),i(213327,{b=1,f=7,rwp=20001,u=1606}),i(213294,{b=1,f=7,rwp=20001,u=1606}),i(213326,{b=1,f=7,rwp=20001,u=1606}),i(213288,{b=1,f=7,rwp=20001,u=1606}),i(213324,{b=1,f=6,rwp=20001,u=1606}),i(213304,{b=1,f=6,rwp=20001,u=1606}),i(213323,{b=1,f=5,rwp=20001,u=1606}),i(213322,{b=1,f=5,rwp=20001,u=1606}),i(213321,{b=1,f=4,rwp=20001,u=1606}),i(215437,{b=1,f=53,rwp=20001,u=1606}),i(216490,{b=1,rwp=20001,u=1606}),i(215435,{b=1,rwp=20001,u=1606}),i(215436,{b=1,rwp=20001,u=1606})}}),n(220007,{description="He will drop pools of toxic slime that both damages and slows those that stand on it. Making sure to move the boss out of these will make it a lot easier for healers.\n\nThe Viscous Fallout boss will also sometimes spawn in 3x Irradiated Goo, these will run towards the fallen Desiccated Fallout in the ground, make sure to kill them before they make it to the corpses or they will respawn the Desiccated Fallout which cause a lot more raid-wide damage if not interrupted. This can be made easier by initially moving the boss to further from the Desiccated Fallout corpses to give longer leeway for killing the Irradiated Goo.",rwp=20001,u=1606,g={i(213291,{b=1,f=20,rwp=20001,u=1606}),i(213352,{b=1,f=23,rwp=20001,u=1606}),i(213353,{b=1,f=28,rwp=20001,u=1606}),i(213289,{b=1,f=28,rwp=20001,u=1606}),i(213355,{b=1,f=33,rwp=20001,u=1606}),i(213307,{b=1,f=3,rwp=20001,u=1606}),i(213413,{b=1,f=5,rwp=20001,u=1606}),i(213302,{b=1,f=5,rwp=20001,u=1606}),i(213299,{b=1,f=5,rwp=20001,u=1606}),i(213301,{b=1,f=4,rwp=20001,u=1606}),i(213285,{b=1,f=4,rwp=20001,u=1606}),i(213290,{b=1,f=4,rwp=20001,u=1606})}}),n(220072,{description="The main mechanic of this fight comes from Static Arc, this ability does a chain lighting cast on a player and it bounces twice, hitting a total of three players - these get debuffed and cannot be hit by it again twice in a row or the 500% damage increase will kill them.\n\nThe way to deal with it is to have two pre-assigned groups be moving in and out of close proximity to the boss in order to soak every other Static Arc. Doing this will make the mechanic safe. Ideally have the caster damage dealers do this so that the melee can keep up high uptime on the boss. Healers can potentially be assigned for moving in and out as well, but ideally it's important that they can heal freely since the fight has somewhat respectable damage throughout.\n\nLastly, Magnetic Pulse is an ability that must be respected by everyone, if targeted the player must move out to a empty space or pre-assigned spot in order to avoid damaging other players as well. Just be aware that if targeted, the player should not by any means ever be further away from the boss than the groups soaking Static Arc, otherwise you'll get targeted by it instead and potentially killing the players with the debuff that are currently standing near the boss.",rwp=20001,u=1606,g={i(213560,{b=1,f=23,rwp=20001,u=1606}),i(213286,{b=1,f=25,rwp=20001,u=1606}),i(213354,{b=1,f=28,rwp=20001,u=1606}),i(213293,{b=1,f=31,rwp=20001,u=1606}),i(213559,{b=1,f=27,rwp=20001,u=1606}),i(213309,{b=1,f=3,rwp=20001,u=1606}),i(213418,{b=1,f=7,rwp=20001,u=1606}),i(213279,{b=1,f=6,rwp=20001,u=1606}),i(213319,{b=1,f=5,rwp=20001,u=1606}),i(213300,{b=1,f=4,rwp=20001,u=1606}),i(213414,{b=1,f=4,rwp=20001,u=1606}),i(213298,{b=1,f=4,rwp=20001,u=1606}),i(213287,{b=1,f=52,rwp=20001,u=1606}),i(216494,{b=1,f=53,rwp=20001,u=1606})}}),n(215728,{description="This fight only requires one tank and should just be tanked normally, the tank should be careful to not get knocked back in order to help with melee dps uptime.\n\nThe boss will initially throw out two gears onto the floor using Gear Toss, which you must dodge as they run linearly through the boss area, they're pretty slow so just position with them in mind since they can knock the players off the platforms and kill them.\n\nOccasionally, the boss will shoot out a frontal Gnomeregan Smash which targets a player and shoots a large projectile that will knock back and kill mainly via fall damage, this can easily be dodged by looking at the boss's feet to see where he's facing since the upper half of the body can be facing elsewhere.\n\nTowards the end of the fight (30%) the boss will also be able to cast The Claw! which will target a random player and dash to grab them and do significant damage - this is telegraphed quite well so healers should pay attention to it and keep that player alive through the initial damage and follow up.",rwp=20001,u=1606,g={i(213442,{b=1,f=1,rwp=20001,u=1606}),i(213295,{b=1,f=21,rwp=20001,u=1606}),i(210741,{b=1,c={2,7,11},f=24,rwp=20001,u=1606}),i(213292,{b=1,f=26,rwp=20001,u=1606}),i(213408,{b=1,f=29,rwp=20001,u=1606}),i(213419,{b=1,f=1,rwp=20001,u=1606}),i(213412,{b=1,f=8,rwp=20001,u=1606}),i(213305,{b=1,f=7,rwp=20001,u=1606}),i(213317,{b=1,f=6,rwp=20001,u=1606}),i(213278,{b=1,f=5,rwp=20001,u=1606}),i(213340,{b=1,f=5,rwp=20001,u=1606}),i(213415,{b=1,f=4,rwp=20001,u=1606}),toy(215449,{b=1,rwp=20001,u=1606})}}),n(218242,{description="The chicken, squirrel and whelp must be tanked, meaning it requires at least two tanks.\n\nThe sheep instead of being tanked, targets a player and slowly moves towards them. It must be kited, ideally somewhat near the other three but not close enough where it'll Binary Bleat silence the melee and tanks.\n\nRanged should stand near the middle so that the tank and melee can kite the bosses around the perimeter of the boss area.\n\nThe dps should try to damage the bosses somewhat evenly - but pay attention to which boss the whelp applies Overheat onto, since this causes that target to get damaged 25% more while the buff is active, making it more effective to focus while it's up.\n\nEvery boss should die at the same time, otherwise they cast Self Repair which only gets canceled by all of them being at 1hp - this ability will heal them for 31% of their total health.",rwp=20001,u=1606,g={i(213410,{b=1,f=20,rwp=20001,u=1606}),i(213297,{b=1,f=23,rwp=20001,u=1606}),i(213296,{b=1,f=22,rwp=20001,u=1606}),i(213411,{b=1,f=27,rwp=20001,u=1606}),i(213306,{b=1,f=3,rwp=20001,u=1606}),i(213308,{b=1,f=3,rwp=20001,u=1606}),i(213280,{b=1,f=6,rwp=20001,u=1606}),i(213303,{b=1,f=6,rwp=20001,u=1606}),i(213320,{b=1,f=6,rwp=20001,u=1606}),i(213325,{b=1,f=6,rwp=20001,u=1606}),i(215380,{b=1,f=6,rwp=20001,u=1606}),i(213318,{b=1,f=5,rwp=20001,u=1606}),i(213417,{b=1,f=7,rwp=20001,u=1606}),r(3966,{itemID=4415,learnedAt=185,requireSkill=202,rwp=20001,u=1606}),r(3959,{itemID=4413,learnedAt=160,requireSkill=202,rwp=20001,u=1606}),r(8339,{itemID=6716,learnedAt=100,requireSkill=202,rwp=20001,u=1606}),r(3944,{itemID=4411,learnedAt=125,requireSkill=202,rwp=20001,u=1606}),r(8243,{itemID=6672,learnedAt=185,requireSkill=202,rwp=20001,u=1606}),r(3971,{itemID=7742,learnedAt=200,requireSkill=202,rwp=20001,u=1606}),r(9269,{itemID=7560,learnedAt=125,requireSkill=202,rwp=20001,u=1606}),r(3968,{itemID=4416,learnedAt=195,requireSkill=202,rwp=20001,u=1606}),r(8895,{itemID=7192,requireSkill=202,rwp=30002,u=1606}),r(3972,{awp=11501,itemID=4417,learnedAt=200,requireSkill=202,rwp=20001,u=1606}),r(3928,{awp=11501,itemID=4408,learnedAt=75,requireSkill=202,rwp=20001,u=1606}),r(3954,{awp=11501,itemID=4412,learnedAt=145,requireSkill=202,rwp=20001,u=1606}),r(3960,{awp=11501,itemID=4414,learnedAt=165,requireSkill=202,rwp=20001,u=1606}),r(3933,{awp=11501,itemID=4409,learnedAt=100,requireSkill=202,rwp=20001,u=1606})}}),n(218537,{description="This fight requires two tanks, as each phase has a different forced tank swap mechanic.\n\nThroughout the fight, the six pillars around the boss arena will ocasionally activate and spawn in bombs if different types depending on the current phase. These pillars must be turned off by clicking the red button to on their right side.\n\nDuring the first phase, the fire boss will be stacking Sprocketfire on the tank, via either Sprocketfire Punch, Furnace Surge, and Incendiary Bombs; and on the raid through the latter two. Furnace Surge can be avoided entirely even by the tank by running directly away from the boss while it does its frontal. Between 5 and 7 stacks, the off-tank should taunt and pick up the boss until the main tank's Sprocketfire runs out.\n\nDuring the second phase, the frost boss will be stacking Freezing on the raid, via Coolant Discharge, and Frost Bomb; and on the tank, via Supercooled Smash. This debuff can be dispelled, meaning one tank can handle the boss the entire phase - without worrying about getting Frozen Solid. Make sure to keep the tank and the raid below 9 stacks, because during the 10th, it will freeze the target, and when Coolant Discharge is cast, it'll causes a raid-wipe.\n\nDuring the third phase, the nature boss will be stacking Radiation Sickness on the raid via Radioactive Bomb; and on the tank through Hazardous Hammer. These stacks should be either dispelled, or at least kept low. Otherwise, when the Toxic Ventilation gets casted, it'll have massive AoE damage. Toxic Ventilation can be interrupted, but the lack of a cast bar can make it more challenging than normal - so those with kicks should pay close attention.\n\nDuring the fourth phase, STX-99/XD will spawn and have all of the abilities mentioned above, although it sounds chaotic, it makes each individual mechanic somewhat easier to deal with, since the none of the three stacks will be major concern as long as you continue dealing with the bombs, and remember the previous basic mechanics.",rwp=20001,u=1606,g={mnt(17458,{b=1,itemID=13325,rwp=20001,u=1606}),i(217350,{b=1,rwp=20001,u=1606}),i(217351,{b=1,rwp=20001,u=1606}),i(213409,{b=1,f=34,rwp=20001,u=1606}),i(213356,{b=1,f=31,rwp=20001,u=1606}),i(213416,{b=1,f=22,rwp=20001,u=1606}),i(213281,{b=1,f=4,rwp=20001,u=1606}),i(216608,{b=1,f=4,rwp=20001,u=1606}),i(213283,{b=1,f=52,rwp=20001,u=1606}),i(213284,{b=1,f=52,rwp=20001,u=1606}),i(213282,{b=1,f=52,rwp=20001,u=1606}),i(215461,{b=1,f=53,rwp=20001,u=1606}),i(213349,{b=1,f=53,rwp=20001,u=1606}),i(213348,{b=1,f=53,rwp=20001,u=1606}),i(213347,{b=1,f=53,rwp=20001,u=1606}),i(213350,{b=1,f=53,rwp=20001,u=1606}),r(3966,{itemID=4415,learnedAt=185,requireSkill=202,rwp=20001,u=1606}),r(3959,{itemID=4413,learnedAt=160,requireSkill=202,rwp=20001,u=1606}),r(8339,{itemID=6716,learnedAt=100,requireSkill=202,rwp=20001,u=1606}),r(3944,{itemID=4411,learnedAt=125,requireSkill=202,rwp=20001,u=1606}),r(8243,{itemID=6672,learnedAt=185,requireSkill=202,rwp=20001,u=1606}),r(3971,{itemID=7742,learnedAt=200,requireSkill=202,rwp=20001,u=1606}),r(9269,{itemID=7560,learnedAt=125,requireSkill=202,rwp=20001,u=1606}),r(9273,{itemID=7561,learnedAt=165,requireSkill=202,rwp=20001,u=1606}),r(3968,{itemID=4416,learnedAt=195,requireSkill=202,rwp=20001,u=1606}),r(8895,{itemID=7192,requireSkill=202,rwp=30002,u=1606}),r(3972,{awp=11501,itemID=4417,learnedAt=200,requireSkill=202,rwp=20001,u=1606}),r(3928,{awp=11501,itemID=4408,learnedAt=75,requireSkill=202,rwp=20001,u=1606}),r(3954,{awp=11501,itemID=4412,learnedAt=145,requireSkill=202,rwp=20001,u=1606}),r(3960,{awp=11501,itemID=4414,learnedAt=165,requireSkill=202,rwp=20001,u=1606}),r(3940,{awp=11501,itemID=4410,learnedAt=120,requireSkill=202,rwp=20001,u=1606}),r(3933,{awp=11501,itemID=4409,learnedAt=100,requireSkill=202,rwp=20001,u=1606})}})}})}}),inst(232,{lore="Protected by the fierce Maraudine centaur, Maraudon is one of the most sacred sites within Desolace. The great temple/cavern is the burial place of Zaetar, one of two immortal sons born to the demigod, Cenarius. Legend holds that Zaetar and the earth elemental princess, Theradras, sired the misbegotten centaur race. It is said that upon their emergence, the barbaric centaur turned on their father and killed him. Some believe that Theradras, in her grief, trapped Zaetar's spirit within the winding cavern - used its energies for some malign purpose. The subterranean tunnels are populated by the vicious, long-dead ghosts of the Centaur Khans, as well as Theradras' own raging, elemental minions.",lvl=41,mapID=280,maps={67,68,281},savedInstanceID=349,u=1607,["zone-text-areaID"]=2100,g={n(-1000031,{q(7065,{coords={{63.8,10.6,1443}},lvl=45,qgs={13698},r=2,rwp=40003,g={qo(1,{providers={{"n",12201}}}),s(128965,17705,{b=1,f=25,rwp=40003}),s(129002,17743,{b=1,f=28,rwp=40003}),s(129012,17753,{b=1,f=32,rwp=40003})}}),q(7064,{coords={{26.9,77.7,1443}},lvl=45,qgs={13699},r=1,rwp=40003,g={qo(1,{providers={{"n",12201}}}),s(128965,17705,{b=1,f=25,rwp=40003}),s(129002,17743,{b=1,f=28,rwp=40003}),s(129012,17753,{b=1,f=32,rwp=40003})}}),q(7044,{coords={{32.1,64,1443}},qgs={13697},rwp=40003,g={qo(1,{providers={{"i",17703}}}),qo(2,{providers={{"i",17702}}})}}),q(7066,{description="This quest becomes available after you defeat Princess Theradras",providers={{"i",17760}},qgs={12238},rwp=40003}),q(7070,{coords={{66.4,49.3,1445}},qgs={4967},r=2,rwp=40003,g={qo(1,{crs={11777,11778},providers={{"i",17756}}}),i(17773,{b=1,f=51,rwp=40003}),i(17772,{b=1,f=51,rwp=40003})}}),q(7068,{coords={{39.2,86.3,1454}},qgs={7311},r=1,rwp=40003,g={qo(1,{crs={11777,11778},providers={{"i",17756}}}),i(17773,{b=1,f=51,rwp=40003}),i(17772,{b=1,f=51,rwp=40003})}}),q(7067,{coords={{50.5,86.7,1443}},providers={{"i",17781}},qgs={13717},rwp=40003,g={qo(1,{cost={{"i",17765,1},{"i",17764,1},{"i",17763,1},{"i",17762,1},{"i",17761,1},{"i",17757,1}},providers={{"i",17758}}}),i(17757,{coords={{28.1,62.4,1443}},crs={13718}}),i(17761,{b=1,coords={{29.7,60.5,1443}},crs={12240,13742},description="Kolk is standing by the little room where you create the portal for Inner Maraudon, in the middle part.\n\nTo attack him, use the Amulet of Spirits that you got from The Nameless Prophet."}),i(17762,{b=1,coords={{29.4,56.9,1443}},crs={12239,13741},description="Gelk is located outside the portal of the purple path, hanging with snakes and rock elementals. He is almost just below the portal (use the stairs to get to hi