 symbol of the night elves' rich culture and glorious history.",g={n(-1000020,{faction(69,{icon=_.asset("Achievement_Character_Nightelf_Female"),OnTooltip=function(t, tooltipInfo)	local reputation = t.reputation;	if reputation < 42000 then	_.Modules.FactionData.AddReputationTooltipInfo(tooltipInfo, reputation, "Runecloth Turn Ins",	50,	42000);	end	end,r=2})}),n(-1000031,{q(7799,{coords={{64,23,1457}},cost={{"i",4338,60}},lvl=40,qgs={14725},r=2,rwp=40003}),q(7800,{coords={{64,23,1457}},cost={{"i",14047,60}},lvl=50,qgs={14725},r=2,rwp=40003}),q(7798,{coords={{64,23,1457}},cost={{"i",4306,60}},lvl=26,qgs={14725},r=2,rwp=40003}),q(7792,{coords={{64,23,1457}},cost={{"i",2592,60}},lvl=12,qgs={14725},r=2,rwp=40003}),q(5647,{altQuests={5641,5645},c={5},coords={{39.2,81,1457}},lvl=20,maps={1455},qgs={11401},races={3},rwp=20300,g={r(6346)}}),q(7801,{coords={{64,23,1457}},cost={{"i",14047,20}},lvl=50,maxReputation={69,42000},qgs={14725},r=2,repeatable=1,rwp=40003,sourceQuests={7800}}),q(3763,{coords={{67.4,15.7,1457}},isBreadcrumb=1,lvl=47,nextQuests={3764},qgs={6735},r=2,rwp=40003}),q(3790,{coords={{18.1,51.5,1455}},isBreadcrumb=1,lvl=47,nextQuests={3764},qgs={5111},r=2,rwp=40003}),q(3789,{coords={{60.4,75.3,1453}},isBreadcrumb=1,lvl=47,nextQuests={3764},qgs={6740},r=2,rwp=40003}),q(4510,{coords={{42,85.8,1457}},lvl=50,providers={{"i",11843}},qgs={7740},r=2,rwp=40003,sourceQuests={4508},g={s(124516,11870,{b=1,f=1,rwp=40003}),s(124517,11871,{b=1,f=5,rwp=40003}),s(124518,11872,{b=1,f=7,rwp=40003})}}),q(2242,{c={4},coords={{37,21.9,1457}},lvl=10,maps={1438},qgs={4163},r=2,rwp=40003,sourceQuests={2241},g={qo(1,{coords={{37.6,22.2,1438}},crs={6909},description="This item can only be pickpocketed.",providers={{"i",7737}}}),s(121842,7298,{b=1,c={4},f=20,rwp=40003})}}),q(5672,{altQuests={5673,5675},c={5},coords={{39.2,81,1457},{25,8.2,1455},{38.8,26.6,1453}},lvl=20,qgs={376,11401,11406},races={4},rwp=30002,g={r(2651,{rank=1})}}),q(2260,{c={4},coords={{34.6,25.6,1457}},isBreadcrumb=1,