agic.\n\nAlthough Deadwind Pass has no quests, the mobs there are tuned to level 50-60 players.\n\nTrivia:\nMedivh, the last Guardian, made Deadwind Pass his final place. The tower of Karazhan to the south served as his bastion until his final days.\n\nAlthough Karazhan is sealed off to players, the Karazhan Crypts can be explored by players who kill themselves and traverse the gates as a ghost. The crypt is filled to the brim with disturbing content, the most disturbing being a pool filled with human bodies hanged upside down and roped to chains. This area became known to players as the Upside-Down Sinners.",maps={350},g={n(-1000004,{ach(777,{description="Explore Deadwind Pass, revealing the covered areas of the world map.",OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(2697),exp(2562),exp(2938),exp(2561)}),n(-1000031,{q(80120,{coords={{52,34.2,1430}},qgs={218920},sourceQuests={80098,80147,80148,80149,80150,80151,80152},u=1606,g={i(217014,{b=1,f=55,u=1606,g={i(213144,{b=1,c={5},f=55,u=1606,g={r(425312,{u=1606})}}),i(213124,{b=1,c={3},f=55,u=1606,g={r(416086,{u=1606})}}),i(213100,{b=1,c={9},f=55,u=1606,g={r(416014,{u=1606})}}),i(213130,{b=1,c={2},f=55,u=1606,g={r(426180,{u=1606})}}),i(213104,{b=1,c={1},f=55,u=1606,g={r(416005,{u=1606})}}),i(213137,{b=1,c={4},f=55,u=1606,g={r(415926,{u=1606})}}),i(213118,{b=1,c={11},f=55,u=1606,g={r(424765,{u=1606})}}),i(216606,{b=1,c={7},f=55,u=1606,g={r(436368,{u=1606})}}),i(213112,{b=1,c={8},f=55,u=1606,g={r(401763,{u=1606})}})}})}}),q(80148,{coords={{52,34.2,1430}},maps={1417},providers={{"i",216947}},qgs={218920},u=1606}),q(80152,{coords={{52,34.2,1430}},maps={1418},providers={{"i",216951}},qgs={218920},u=1606}),q(80098,{coords={{52,34.2,1430}},providers={{"i",216945}},qgs={218920},u=1606}),q(80151,{coords={{52,34.2,1430}},maps={1443},providers={{"i",216950}},qgs={218920},u=1606}),q(80147,{coords={{52,34.2,1430}},maps={1431},providers={{"i",216946}},qgs={218920},u=1606}),q(80149,{