 haunted and wild, characterized by its tall, silver-barked pines towering over grassy knolls. The Alliance once protected Silverpine Forest when it was verdant and lively. Now the place is shrouded in ghostly mists. Forsaken control the northern forest. What remains of the human population retains control of the southern forest, but they are desperate and their forces thinly stretched. Dalaran sends frequent expeditions into Silverpine to defend these people and study the undead plague and worgen curse — a mysterious affliction that causes its victims to transform into bloodthirsty, lycanthropic worgen when the moon rises.",g={n(-1000004,{ach(769,{description="Explore Silverpine Forest, revealing the covered areas of the world map.",OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(233),exp(231),exp(213),exp(172),exp(238),exp(928),exp(229),exp(204),exp(236),exp(232),exp(240),exp(237),exp(230),exp(239),exp(228),exp(927),exp(226),exp(227)}),n(-1000021,{fp(10,{coords={{45.6,42.6,1421}},crs={2226},r=1})}),n(-1000031,{q(530,{coords={{62,43,1458}},lvl=10,qgs={2050},r=1,rwp=40003,sourceQuests={441},g={qo(1,{coords={{46.4,84.6,1421}},crs={2332},providers={{"i",3613}}}),i(3235,{b=1,f=52,rwp=40003})}}),q(447,{coords={{43.4,40.8,1421}},lvl=9,qgs={1937},r=1,rwp=40003,g={qo(1,{crs={1778,1797,12432},providers={{"i",3253}}}),qo(2,{crs={1780,1781,12433},providers={{"i",3254}}}),i(3448,{f=55})}}),q(450,{coords={{48.6,69.4,1458}},lvl=9,qgs={2055},r=1,rwp=40003,sourceQuests={447},g={qo(1,{coords={{43,73.3,1421}},providers={{"i",3255},{"o",1594}}})}}),q(451,{coords={{43.4,40.8,1421}},lvl=9,qgs={1937},r=1,rwp=40003,sourceQuests={450},g={qo(1,{crs={1953,1954},providers={{"i",3256}}}),qo(2,{crs={1955,1956},providers={{"i",3257}}}),qo(3,{crs={1767,1768,1908,1909,1957,1958},providers={{"i",3258}}}),s(118774,3451,{b=1,f=1,rwp=40003}),s(200845,3582,{b=1,f=3,rwp=40003}),i(2458,{f=55}),i(2459,{f=55})}}),q(479,{coords={{44,41,1421}},lvl=10,qgs={2121