ent funds and might to retake the region. A handful of farmers still try to keep their land, and some even attempt a tithe to Stormwind every year, but most only grow enough to feed themselves. The Defias Brotherhood controls much of the region, focused in the southern area of Moonbrook.\n\nOnce a rich agricultural center, much of Westfall now lies fallow and forgotten. The Defias Brotherhood, renegade humans who wield secrecy and technology against Stormwind, control much of the area. Bandits and gnolls raid those farms that remain, and Stormwind's resources are stretched too thin to protect the beleaguered populace. Westfall has the mild temperatures of Elwynn, but winds batter it both from the sea and from Duskwood. The bare farmlands add little to break the wind, which can cut through clothing on a blustery day.",g={n(-1000004,{ach(802,{description="Explore Westfall, revealing the covered areas of the world map.",OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(219),exp(921),exp(109),exp(113),exp(111),exp(20),exp(107),exp(108),exp(919),exp(920),exp(917),exp(922),exp(916),exp(918),exp(115)}),n(-1000021,{fp(4,{coords={{56.6,52.6,1436}},crs={523},r=2})}),sp(921,{c={4},g={i(209031,{b=1,c={4},coords={{48.6,48.6,1436}},crs={95,121,504,589,590},u=1605,g={i(209030,{b=1,c={4},u=1605}),i(209029,{b=1,c={4},u=1605})}}),i(208772,{b=1,c={4},coords={{51,47,1436},{51.6,55.6,1436}},crs={210549},f=55,rwp=20001,u=1605,g={r(424984,{u=1605})}})}}),n(-1000031,{q(6181,{coords={{56.9,47.2,1436}},lvl=10,providers={{"i",15998}},qgs={491},races={1},rwp=40003}),q(136,{lvl=10,providers={{"i",1357}},rwp=40003}),q(138,{coords={{25.9,47.77,1436}},lvl=10,providers={{"o",35},{"i",1358}},rwp=40003,sourceQuests={136}}),q(139,{coords={{40.5,47.82,1436}},lvl=10,providers={{"o",36},{"i",1361}},rwp=40003,sourceQuests={138}}),q(140,{coords={{40.62,17.01,1436},{25.97,16.9,1436}},lvl=10,providers={{"o",34},{"i",1362},{"o",33}},rwp=40003,sourceQuests={139},g=